import image from "../monstera.jpg"

export default function Home() {
    return (
        <main>
            <img src="{image}" alt="Monstera Leaves" className="absolute object-cover w-full h-full " />
            <section>
                <h1>An Aspiring Geek.</h1>
            </section>
        </main>
    )
}
